import React from 'react';
import {FaCheckDouble} from 'react-icons/fa';

const NavBar = (props) => {
    return(
        <nav class="navbar mb-5 py-2">
            <a class="navbar-brand m-0 p-0" href="#">do.ly<FaCheckDouble /></a>
            <div className="mr-1 w-10">
            <div class={`${props.user ? '' : 'd-none'} dropdown-toggle`} style={{backgroundColor: props.user.color, height: 40, width: 40, borderRadius: 50}}></div>
            <button class={`${props.user ? '' : 'd-none'} btn log-out`} onClick={() => props.logOut()}>Log Out</button>
            </div>
        </nav>
    )
}

export default NavBar
